    false,nt"url": null,nt"notes": "This narrative report for Chautauqua NWR
    outlines Refuge accomplishments from May through August of 1956. The report begins
    by summarizing the weather conditions and water conditions during this period. Wildlife-
    including migratory birds, upland game birds, and fish- is also covered. The Refuge
    development and maintenance section discusses physical developments and plantings.
    Resource management is outlined; topics include commercial fishing. A progress report
    on field investigations and applied research is also provided. The public relations
    section of the report describes recreational uses, Refuge visitors, Refuge participation,
    fishing, and violations. N-R forms and photographs are attached.",nt"owner_org":
